import React from "react";
import TableRow from "./TableBody/TableRow";
import TableHead from "./TableHead";

const Table = ({ matrix }) => {
   let rows = matrix.map((row, index) => {
      return <TableRow key={index} data={row} />;
   });

   return (
      <table>
         <TableHead matrix={matrix} />
         <tbody>{rows}</tbody>
      </table>
   );
};

export default Table;
